import login_img from "../../../img/login.jpg";
import { Box } from "@material-ui/core";
import MyTextField from "../data/MyTextField";
import { Button } from "@babel/core";
const Home = () => {
  return (
    <>
      <div className="bg">
        <div className="clild_div shadow">
          <div className="row">
            <div className="col-6">
              <div className="login_img_div">
                <div
                  className="login_img"
                  style={{ backgroundImage: `url(${login_img})` }}
                ></div>
              </div>
            </div>
            <div className="col-6">
              <div className=" p-5">
                <Box component="form">
                  <MyTextField label="Email Id" type="email" />
                  <MyTextField label="Password" type="password" />
                  <Box component="div">
                    <Button variant="outlined" color="secondary">
                      Secondary
                    </Button>
                  </Box>
                </Box>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
